import axios from 'axios'; 



const List =()=>{

const [useData, setUseData]=useState(null);
const onClick=async()=>{
    try{
        const res=await axios.get('http://172.20.67.54:8080/reels/applicant?hashtag=#HYPE BOY',
        );
        setUseData(res.data);
    }catch(e){
        console.log(e);
    }
};



    return(
        <>
        <button onClick={onClick}>불러오기</button>
        <div>{useData && <textarea rows={7} value={JSON.stringify(useData, null, 2)} readOnly={true} />}</div>
        </>
    );
};
export default List;
